Задача коммивояжера - это классическая задача теории оптимизации. Она заключается в поиске кратчайшего маршрута, который проходит через все заданные города и возвращается в исходную точку.

Вот пример кода на языке программирования C#, который решает эту задачу:

```csharp
using System;
using System.Collections.Generic;

class Program
{
    static void Main()
    {
        // Данные задачи (города и расстояния между ними)
        int[,] distances = new int[5, 5]
        {
            {0, 4, 8, 12, 16},
            {4, 0, 7, 11, 15},
            {8, 7, 0, 9, 13},
            {12, 11, 9, 0, 5},
            {16, 15, 13, 5, 0}
        };

        // Алгоритм поиска кратчайшего пути (например, алгоритм Дейкстры)
        List<int> shortestPath = Dijkstra(distances);

        // Вывод результата
        foreach (var city in shortestPath)
        {
            Console.Write($"{city} ");
        }
        Console.WriteLine();
    }

    // Реализация алгоритма Дейкстры для поиска кратчайшего пути
    static List<int> Dijkstra(int[,] distances)
    {
        // Инициализация массива расстояний
        int n = distances.GetLength(0);
        bool[] visited = new bool[n];
        int[] dist = new int[n];
        int[] prev = new int[n];

        for (int i = 0; i < n; i++)
        {
            dist[i] = distances[0, i];
            prev[i] = 0;
        }

        dist[0] = 0;

        while (!visited[n - 1])
        {
            int u = FindMinDistance(dist, visited);

            visited[u] = true;

            for (int v = 0; v < n; v++)
            {
                if (!visited[v] && dist[u] + distances[u, v] < dist[v])
                {
                    dist[v] = dist[u] + distances[u, v];
                    prev[v] = u;
                }
            }
        }

        return BuildShortestPath(prev, n);
    }

    // Поиск города с минимальным расстоянием
    static int FindMinDistance(int[] dist, bool[] visited)
    {
        int minDist = int.MaxValue;
        int minIndex = -1;

        for (int i = 0; i < dist.Length; i++)
        {
            if (!visited[i] && dist[i] < minDist)
            {
                minDist = dist[i];
                minIndex = i;
            }
        }

        return minIndex;
    }

    // Восстановление кратчайшего пути
    static List<int> BuildShortestPath(int[] prev, int n)
    {
        List<int> path = new List<int>();
        int current = n - 1;

        while (current != 0)
        {
            path.Add(current);
            current = prev[current];
        }

        path.Reverse();
        return path;
    }
}
```

Этот код реализует алгоритм Дейкстры для решения задачи коммивояжера. Он принимает матрицу расстояний между городами и вычисляет оптимальный маршрут. Результат выводится в консоль.

